import React, { useState } from "react";

const Shop = function(){
    const [goods, setgoods] = useState([
        {title: 'TowerDefence', description: 'A little bit about the good'},
        {title: 'TowerDefence', description: 'A little bit about the good'},
    ])
    return (
        <div>
            {goods.map(good => <div>GOOD</div>)}
        </div>
    );
}

export default Shop;
